const Header = () => {
  return (
    <header className="topNav">
      <nav className="navbar nnavbar-expand-md navbar-dark">
        <div className="navbar-fluid">
          <a className="navbar_brand" href="g">
            <img className="nav_logo" src="https://brandslogos.com/wp-content/uploads/images/large/netflix-logo.png" alt="ff" />
          </a>
          <div className="navbar">
            <form className="d-flex" role="search">
              <select>
                <option>English</option>
                <option>Hindi</option>
              </select>
            </form>
          </div>
        </div>
      </nav>
    </header>
  );
};
export default Header;
